window.bookSummaryJSON = "<p>The BrainsKendall Morgan, a relic expert born with the family gift for sensing the history and location of ancient artifacts. The BucksNathan Larraby, the enigmatic billionaire who has hired Kendall to locate four powerful relics. The BrawnJake Stone, the tough, sexy mercenary with a mysterious past, contracted to protect Kendall. </p> <p>Every mission Kendall accepts carries certain hazards, but Nathan’s latest is proving to be the most dangerous yet. Kendall’s attraction to Jake - and to Nathan - is making it hard to stay focused, and none of them can afford the distraction. Because there’s someone else hunting the relics, someone who will stop at nothing to put them to his own sinister use. But the dark secrets Nathan’s keeping could cost them the mission, their lives...and the history of mankind.</p>"; 
